   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹威力 = _parent._parent.空手攻击力 * 4;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 60;
   击倒率 = 1;
   子弹敌我属性 = !_parent._parent.是否为敌人;
   子弹种类 = "近战子弹";
   if(_parent._parent.极度愤怒 >= 60)
   {
      子弹威力 = _parent._parent.空手攻击力 * 12;
      子弹种类 = "黑龙暴怒";
      _parent._parent.极度愤怒 -= 60;
